 Name: closeTabIA
 ID: 1
 DataType: method
 RandomSeed: 30
 Value: |+1
  -- interaction close of 3 table files
  param bb:boolean
  
  var str:string
  
  str := @.name
  @.isOpen := false
  dialog.setCaption(to_str(str,"_But"),rootfolder.localization.getText(42)) -- "Show"

-
 Name: realMax
 ID: 2
 DataType: real
 Value: 1e+300
-
 Name: OnDragDrop
 ID: 3
 DataType: method
 RandomSeed: 29
 Value: |+1
  param dragObject: string /*an object or text*/
  
  var str : string;var L,numSources:integer
  
  var obj:object := dragObject
  var ApplObj:object := rootfolder.BasicObjects.&Meth.WizardObj -- object link
  var debugging:boolean := ApplObj.debug_Mode
  
  switch obj.internalClassName
  case "NwSource" 
  	AssignedSources.closeDialog
  	AssignedSources.setCursor(1,1)
  	if NOT AssignedSources.find({1,1}..{1,*},obj) 
  		numSources := AssignedSources.yDim + 1
  		AssignedSources[1,numSources] := obj-- "Source"
  		
  		-- set reasonable the variable MUclass
  		if MUclass = void AND obj.MUselection.isset("constant")
  			var MU:object := obj.path
  			if MU /= void
  				switch MU.internalClassName
  				case "Piece","Goods","Vehicle" 
  					MUclass := MU
  					dialog.setCaption("MU_Inp", to_str(MUclass))
  				end
  			end
  		end	
  		
  		str := makePathRelative(Attributes, obj.~)
  		L := strLen(str)
  		str := to_str(strCopy(str,1,L-10),"SourceTable")
  		obj.path := str
  		if debugging then print "Assign the source ",obj;end
  		
  		for var j := 1 to AssignedSources.yDim 
  			obj := AssignedSources[1,j]
  			if obj/=void 
  				AssignedSources[1,j] := makepathrelative(obj,current)
  			else
  				AssignedSources[1,j] := void
  			end
  		next
  		Dialog.setTable("SourceList",AssignedSources)
  	else
  		if debugging then print "Already registered source object.";end
  	end
  	dialog.setTable("SourceList",assignedSources)
  	obj.MUselection := "Random"
  	--AssignedSources.opendialogBox;
  	
  case "Piece","Goods","Vehicle" 
  	MUclass := obj -- "MU"
  	dialog.setCaption("MU_Inp", to_str(MUclass))
  	if debugging then print "Assign the movable element ",obj;end
  else
  	if debugging then print "Please assign an source object or a movable element.";end
  end
  
  /*if MUclass = void 
  	MUclass := rootfolder.BasicObjects.Default_MU
  end*/
