 Name: countVariants
 ID: 11
 DataType: method
 RandomSeed: 26
 Value: |+1
  ->integer
  
  if Attributes.yDim = 0 then return 0;end
  result := 1
  for var k := 1 to Attributes.yDim 
  	result *= Attributes[1,k].yDim
  next
  result := max(1,result)
